import React, { useEffect, useState } from "react";
import { Link, useParams } from "react-router-dom";
import axios from "axios";

const CrewInfo = () => {
  const [crew, setCrew] = useState([]);
  const { id } = useParams();
  console.log(id);
  useEffect(() => {
    axios.get(`https://api.spacexdata.com/v4/crew/${id}`).then((response) => {
      console.log(response.data);
      setCrew(response.data);
    });
  }, [id]);
  return (
    <div className="container text-start" style={{ marginTop: "40px" }}>
      <div className="row">
        <div className="col-sm-4">
          <h1>crew</h1>
          <img src={crew.image} className="img" style={{ width: "450px" }} />
        </div>
        {/* <div className="col-sm-6 mx-5 my-5 text-light"> */}
          <div className="row">
            <div className="col-sm-6"></div>
          </div>
          <div className="container ">
            <a href={crew.wikipedia} className="btn btn-outline-light">
              Wikipedia
            </a>
            <Link to="/crew" className="btn btn-outline-light mx-2">
              Back
            </Link>
          </div>
        {/* </div> */}
      </div>
    </div>
  );
};

export default CrewInfo;
